window.bookSummaryJSON = "<p>Francesca Sabatini came to America to take in the sights, celebrate her high school graduation, and have fun wasting time before college starts in the fall.</p> <p>That's not what happens.</p> <p>Fresh off the plane and barely on American soil more than a handful of minutes, Francesca's face is recognized by TSA scanners to be a match for a child who was kidnapped 12 years ago.</p> <p>Brody Mason remembers the day Fiona Sullivan went missing during a family vacation in Italy, and it's haunted him his whole life. So when Francesca shows up at the Sullivan farm down the road, he's compelled to figure out if this girl really is his long-lost friend.</p> <p>But Francesca knows she's not Fiona Sullivan. She knows exactly who she is. At least she thinks she knows - until Brody Mason relentlessly pursues her and she begins to have feelings for him. Maybe being Fiona isn't so bad?</p> <p>Reality becomes blurred, secrets are revealed, and life will never be the same when the final questions are answered: Is she Francesca or Fiona? And where does she really belong?</p> <p><i>Losing Francesca</i> is a mature young-adult/new-adult novel that explores the meaning of friendship, family, love, and forgiveness.</p>"; 
